import React from 'react';
import './index.css';
const ContactDetails=(props)=>{
    return(<>
        <div className="detailsCon">
            <h6>Name : {props.Ammo}</h6>
            <p>Contact : {props.Memmo}</p>
        </div>
    </>)
}
export default ContactDetails;
